    return (
      <section className={ style.search }>
        <section className="products">
          <SideBar
            { ...this.props }
          />
          <SearchProducts
            { ...this.props }
          />
          <Link
            to="/ShoppingCart"
            data-testid="shopping-cart-button"
          >
